Latin1 = {
    stringify: function(wordArray) {
        for (var words = wordArray.words, sigBytes = wordArray.sigBytes, latin1Chars = [], temp = [], i = 0; i < sigBytes; i++) {
            var bite = words[i >>> 2] >>> 24 - i % 4 * 8 & 255;
            temp.push(bite);
            latin1Chars.push(String.fromCharCode(bite));
        }
        console.log(wordArray.words[123])
        return latin1Chars.join("")
    },
    parse: function(latin1Str) {
        for (var latin1StrLength = latin1Str.length, words = [], i = 0; i < latin1StrLength; i++)
            words[i >>> 2] |= (255 & latin1Str.charCodeAt(i)) << 24 - i % 4 * 8;
        return new WordArray.init(words,latin1StrLength)
    }
}
Utf8 = {
    stringify: function(wordArray) {
        try {
            return decodeURIComponent(encodeURI(Latin1.stringify(wordArray)))
        } catch (e) {
            throw new Error("Malformed UTF-8 data")
        }
    },
    parse: function(utf8Str) {
        return Latin1.parse(decodeURIComponent(encodeURIComponent(utf8Str)))
    }
}
const decrypt = function(url, text) {
    if ("string" != typeof url)
        return;
    const str = function(str) {
        const encode2 = encodeURI(str);
        return btoa(encode2)
    }(url).repeat(3)
      , orgKey = str.slice(0, 16)
      , orgIv = str.slice(12, 28)
      , ikey = Utf8.parse(orgKey)
      , iiv = Utf8.parse(orgIv)
    return cryptoJs.AES.decrypt(text, ikey, {
        iv: iiv,
        mode: cryptoJs.mode.CBC,
        padding: cryptoJs.pad.Pkcs7
    }).toString(Utf8)
};

